import Fragment from "./components/basic/Fragment";

export default () => (
    <div id="app">
      <h1>Fundamentos React</h1>
      <Fragment />
      <WParams title="Situação do Aluno" aluno="Pedro" nota={9.3} />
      <First></First>
    </div>
  );
